05,'broadcast_request','0'),(106,'track_distance','0'),(107,'store_instagram_link','https://instagram.com/cluster_col'),(108,'provider_commission_percentage','0'),(114,'page_privacy','<p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; T&Eacute;RMINOS Y CONDICIONES</strong></p>\r\n\r\n<hr />\r\n<p>Los t&eacute;rminos y condiciones enunciadas en el presente documento (en adelante, el ACUERDO), constituyen el acuerdo legal entre ANUNCIANTE y <a href=\"http://www.cluster.com/\">www.cluster.com</a>.co , (en adelante &ldquo;LA EMPRESA&rdquo;, &ldquo;EL SITIO&rdquo; o &ldquo;PLATAFORMA TECNOL&Oacute;GICA&rdquo;), propietaria de la app <a href=\"http://www.cluster.com/\">www.cluster.com</a>.co (en adelante LA APLICACI&Oacute;N) y de la web <a href=\"http://www.cluster.com/\">www.cluster.com</a>.co ; as&iacute; como entre LA EMPRESA y el SOLICITANTE (quien requiere servicios). Tambi&eacute;n constituyen los t&eacute;rminos y condiciones de uso de la Plataforma Tecnol&oacute;gica por parte de SOLICITANTE y ANUNCIANTE (en adelante LOS USUARIOS), as&iacute; como la pol&iacute;tica de tratamiento de datos personales por parte de LA EMPRESA. El ACUERDO fue desarrollado de conformidad con lo dispuesto en la Constituci&oacute;n Pol&iacute;tica de Colombia, la ley 1341 de 2009, la Resoluci&oacute;n 3066 de 2011, la Ley 1581 de 2012, el Decreto Reglamentario 1377 de 2013 y dem&aacute;s disposiciones jur&iacute;dicas pertinentes y ser&aacute; aplicada por LA EMPRESA respecto de la utilizaci&oacute;n de las Tics; as&iacute; como de la recolecci&oacute;n, almacenamiento, uso, circulaci&oacute;n, publicaci&oacute;n, supresi&oacute;n y dem&aacute;s actividades que constituyan tratamiento de datos personales. El ACUERDO tambi&eacute;n detalla los derechos de autor y las condiciones generales aplicables al acceso a los servicios ofrecidos por LA EMPRESA. Al acceder a la Plataforma Tecnol&oacute;gica, LOS USUARIOS declaran conocer y aceptar los siguientes t&eacute;rminos y condiciones:</p>\r\n\r\n<p>Los T&eacute;rminos y Condiciones y las Pol&iacute;ticas de Privacidad contenidos en este instrumento se aplicar&aacute;n y se entender&aacute;n como parte integral de todos los actos y contratos que se ejecuten o celebren mediante los sistemas de oferta y comercializaci&oacute;n comprendidos en este sitio, entre EL ANUNCIANTE de <a href=\"http://www.cluster.com/\">www.cluster.com</a>.co , por cualquiera de las otras sociedades o empresas que sean filiales o vinculadas a ella, y que hagan uso de este sitio, a las cuales se las denominar&aacute; en adelante tambi&eacute;n en forma indistinta como &quot;El Anunciante&quot;, o bien &quot;La Empresa Oferente&quot;, &quot;El Proveedor de Servicios&quot; o &quot;La Empresa Proveedora&quot;, seg&uacute;n convenga al sentido del texto; de una parte, y de la otra EL SOLICITANTE, sea este una persona natural o jur&iacute;dica.</p>\r\n\r\n<p>CUALQUIER USUARIO QUE NO ACEPTE ESTOS T&Eacute;RMINOS Y CONDICIONES Y LAS POL&Iacute;TICAS DE PRIVACIDAD, LOS CUALES TIENEN UN CAR&Aacute;CTER OBLIGATORIO Y VINCULANTE, DEBER&Aacute; ABSTENERSE DE UTILIZAR EL SITIO Y/O LOS SERVICIOS.</p>\r\n\r\n<p>EL USUARIO debe leer, entender y aceptar todas las condiciones establecidas en los T&eacute;rminos y Condiciones y en las Pol&iacute;ticas de Privacidad de <a href=\"http://www.cluster.com/\">www.cluster.com</a>.co as&iacute; como en los dem&aacute;s documentos incorporados a los mismos por referencia; previo a su registro como USUARIO del SITIO y/o a la adquisici&oacute;n de productos y/o servicios, o entrega de cualquier dato con cualquier fin. El USUARIO acepta que todo acto de registro, adquisici&oacute;n de servicios, o entrega de cualquier dato con cualquier fin por parte suya; es su manifestaci&oacute;n expresa de aceptaci&oacute;n de todas las condiciones establecidas en los T&eacute;rminos y Condiciones y en las Pol&iacute;ticas de Privacidad de <a href=\"http://www.cluster.com/\">www.cluster.com</a>.co.</p>\r\n\r\n<p>Por dicha utilizaci&oacute;n del SITIO y/o sus servicios, el USUARIO se obligar&aacute; a cumplir expresamente con las mismas, no pudiendo alegar el desconocimiento de tales T&eacute;rminos y Condiciones y de las Pol&iacute;ticas de Privacidad.</p>\r\n\r\n<p><strong>1. LA EMPRESA o EL SITIO</strong>. LA EMPRESA o EL SITIO es una Plataforma Tecnol&oacute;gica (aplicativo m&oacute;vil y web de <a href=\"http://www.cluster.com/\">www.cluster.com</a>.co ), o soluci&oacute;n multimedia que permite la b&uacute;squeda de informaci&oacute;n comercial con gu&iacute;as de servicios para uso del p&uacute;blico en general, a la que se puede acceder por terminales fijas o m&oacute;viles de computaci&oacute;n o por tel&eacute;fonos m&oacute;viles o por cualquier otra herramienta tecnol&oacute;gica que permita o facilite el acceso a p&aacute;ginas web de internet y/o aplicativos m&oacute;viles; que acerca a los ANUNCIANTE y SOLICITANTES y les facilita realizar transacciones de car&aacute;cter comercial, en especial las relacionadas con la adquisici&oacute;n de servicios de transporte terrestre, de car&aacute;cter p&uacute;blico o privado. <strong>LA PLATAFORMA TECNOL&Oacute;GICA no presta servicios de transporte;</strong> tampoco sugiere ANUNCIANTES y/o transportadores y/o servicios y por tanto, no es responsable por el contenido de la informaci&oacute;n entregada por EL ANUNCIANTE, como tampoco por la calidad, disponibilidad, cumplimiento, trato personal o las garant&iacute;as de los bienes o servicios que EL ANUNCIANTE le proporcione al SOLICITANTE y a los que &eacute;ste libre y voluntariamente acceda en &ldquo;el Sitio&rdquo;; ni por las cotizaciones u ofertas de sus servicios enviadas a trav&eacute;s del SITIO, como tampoco por las posteriores relaciones comerciales y/o transacciones que surjan entre &eacute;stos, todas las cuales se realizar&aacute;n por cuenta y riesgo del ANUNCIANTE y el SOLICITANTE en el &aacute;mbito de las responsabilidades que a cada uno la Ley le asigne. Por lo tanto la responsabilidad por la informaci&oacute;n (incluyendo material fotogr&aacute;fico, videos, textos, y toda la informaci&oacute;n relacionada con los bienes y servicios, ofertas y cotizaciones) ser&aacute; del ANUNCIANTE. La Plataforma Tecnol&oacute;gica ofrece servicios de informaci&oacute;n y/o Directorio Interactivo de ofertas de ANUNCIANTES y SOLICITANTES, y no tiene ni tendr&aacute; ninguna clase de v&iacute;nculo de car&aacute;cter personal, comercial, laboral, contractual de ninguna &iacute;ndole ni extracontractual con ninguno de &eacute;stos.</p>\r\n\r\n<p><strong>2. EL SERVICIO.</strong> La Plataforma Tecnol&oacute;gica anuncia servicios ofrecidos por terceros (ANUNCIANTES), mas no presta ni sugiere ning&uacute;n tipo de servicio a los SOLICITANTES. La Plataforma Tecnol&oacute;gica solo es un enlace entre SOLICITANTES que buscan servicios de transporte p&uacute;blico y/o privado y ANUNCIANTES que ofertan uno o m&aacute;s servicios de transporte p&uacute;blico y/o privado. <a href=\"http://www.cluster.com/\">www.cluster.com</a>.co ofrece informaci&oacute;n acerca de m&uacute;ltiples ofertas de servicios de transporte, as&iacute; como de m&uacute;ltiples solicitudes de b&uacute;squeda de servicios de transporte.</p>\r\n\r\n<p><strong>3. CAPACIDAD LEGAL</strong> Los Servicios anunciados en <a href=\"http://www.cluster.com/\">www.cluster.com</a>.co , s&oacute;lo est&aacute;n disponibles para personas que tengan capacidad legal para contratar. No podr&aacute;n utilizar los servicios las personas que no tengan esa capacidad ni los menores de edad. Los actos que &eacute;stos realicen en este sitio ser&aacute;n responsabilidad de sus padres, tutores legales, encargados o curadores, y por tanto se considerar&aacute;n realizados por &eacute;stos en ejercicio de la representaci&oacute;n legal con la que cuentan. Quien registre un SOLICITANTE como persona jur&iacute;dica, deber&aacute; tener capacidad para contratar a nombre de tal entidad y de obligar a la misma en los t&eacute;rminos de este Acuerdo.</p>\r\n\r\n<p><strong>4. REGISTRO DE USUARIO Y USO DEL SITIO</strong> Es obligatorio completar el formulario de registro en todos sus campos con datos v&aacute;lidos para convertirse en USUARIO de <a href=\"http://www.cluster.com/\">www.cluster.com</a>.co , acceder a las promociones, y para la adquisici&oacute;n de servicios ofrecidos en este sitio. El suscriptor (ANUNCIANTE y/o SOLICITANTE) de <a href=\"http://www.cluster.com/\">www.cluster.com</a>.co, deber&aacute; completar el formulario de registro con su informaci&oacute;n personal de manera exacta, precisa y verdadera (&quot;Datos Personales&quot;) y asume el compromiso de actualizar los Datos Personales conforme resulte necesario. El registro en el SITIO ser&aacute; gratuito en cualquier caso. EL SITIO podr&aacute; utilizar diversos medios para identificar a sus suscriptores, pero <a href=\"http://www.cluster.com/\">www.cluster.com</a>.co, NO se responsabiliza por la certeza de los Datos Personales provistos por &eacute;stos. Los USUARIOS garantizan y responden, en cualquier caso, de la exactitud, veracidad, vigencia y autenticidad de los Datos Personales ingresados. Cada miembro s&oacute;lo podr&aacute; ser titular de 1 (una) cuenta de <a href=\"http://www.cluster.com/\">www.cluster.com</a>.co, no pudiendo acceder a m&aacute;s de 1 (una) cuenta utilizando distintas direcciones de correo electr&oacute;nico o falseando, modificando y/o alterando sus datos personales de cualquier manera posible. Si se verificara o sospechara un uso fraudulento y/o malintencionado y/o contrario a estos T&eacute;rminos y Condiciones y/o contrarios a la buena fe, EL SITIO tendr&aacute; el derecho inapelable de dar por terminados los cr&eacute;ditos, dar de baja las cuentas y hasta de perseguir judicialmente a los infractores.</p>\r\n\r\n<p><a href=\"http://www.cluster.com/\">www.cluster.com</a>.co se reserva el derecho de solicitar alg&uacute;n comprobante y/o dato adicional a efectos de corroborar los Datos Personales, as&iacute; como de suspender temporal o definitivamente a aquellos USUARIOS cuyos datos no hayan podido ser confirmados. En estos casos de inhabilitaci&oacute;n, EL SITIO podr&aacute; dar de baja los servicios solicitados, sin que ello genere derecho alguno a resarcimiento, pago y/o indemnizaci&oacute;n.</p>\r\n\r\n<p>El USUARIO, una vez registrado, dispondr&aacute; de su direcci&oacute;n de email y una clave secreta (en adelante la &quot;Clave&quot;) que le permitir&aacute; el acceso personalizado, confidencial y seguro. En caso de poseer estos datos, el USUARIO tendr&aacute; la posibilidad de cambiar la Clave de acceso. El USUARIO se obliga a mantener la confidencialidad de su Clave de acceso, asumiendo totalmente la responsabilidad por el mantenimiento de la confidencialidad de su Clave secreta registrada en este sitio web, la cual le permite solicitar servicios y obtener informaci&oacute;n (la &quot;Cuenta&quot;). Dicha Clave es de uso personal, y su entrega a terceros no involucra responsabilidad de <a href=\"http://www.cluster.com/\">www.cluster.com</a>.co en caso de utilizaci&oacute;n indebida, negligente y/o incorrecta.</p>\r\n\r\n<p>El USUARIO ser&aacute; responsable por todas las operaciones efectuadas en y desde su Cuenta, pues el acceso a la misma est&aacute; restringido al ingreso y uso de una Clave secreta, de conocimiento exclusivo del USUARIO. EL USUARIO se compromete a notificar a <a href=\"http://www.cluster.com/\">www.cluster.com</a>.co en forma inmediata y por medio id&oacute;neo y fehaciente, cualquier uso no autorizado de su Cuenta y/o Clave, as&iacute; como el ingreso por terceros no autorizados a la misma. Est&aacute; prohibida la venta, cesi&oacute;n, pr&eacute;stamo o transferencia de la Clave y/o Cuenta bajo ning&uacute;n t&iacute;tulo.</p>\r\n\r\n<p><a href=\"http://www.cluster.com/\">www.cluster.com</a>.co se reserva el derecho de rechazar cualquier solicitud de registro o de cancelar un registro previamente aceptado, sin que est&eacute; obligado a comunicar o exponer las razones de su decisi&oacute;n y sin que ello genere alg&uacute;n derecho a indemnizaci&oacute;n o resarcimiento.</p>\r\n\r\n<p><strong>5. MODIFICACIONES DEL ACUERDO EL USUARIO </strong></p>\r\n\r\n<p>EL USUARIO de <a href=\"http://www.cluster.com/\">www.cluster.com</a>.co, acepta el hecho que EL SITIO se reserva el derecho de modificar los T&eacute;rminos y Condiciones Generales en cualquier momento, haciendo p&uacute;blicos en el Sitio. Todos los t&eacute;rminos modificados entrar&aacute;n en vigor a los diez (10) d&iacute;as de su publicaci&oacute;n. Dentro de los cinco (5) d&iacute;as siguientes a la publicaci&oacute;n de las modificaciones introducidas, el USUARIO deber&aacute; dar de baja su cuenta de usuario, si no acepta las mismas; en ese caso quedar&aacute; disuelto el v&iacute;nculo contractual y ser&aacute; inhabilitado como USUARIO. Vencido este plazo, se considerar&aacute; que el USUSARIO acepta los nuevos t&eacute;rminos y el contrato continuar&aacute; vinculando a las partes.</p>\r\n\r\n<p><strong>6. PROCEDIMIENTO PARA HACER USO DE ESTA PLATAFORMA TECNOL&Oacute;GICA Y PEDIR SERVICIOS </strong></p>\r\n\r\n<p>EL SOLICITANTE, previa descarga de la aplicaci&oacute;n y correspondiente registro en la Plataforma Tecnol&oacute;gica; accesar&aacute; a la misma y podr&aacute; visualizar en tiempo real, los veh&iacute;culos que se encuentren disponibles. Acto seguido, podr&aacute; seleccionar y solicitar el respectivo servicio de transporte, &ldquo;clickeando&rdquo; en el aplicativo. El sistema cargar&aacute; la orden de transporte a aqu&eacute;l ANUNCIANTE que se encuentre m&aacute;s cercano. El respectivo ANUNCIANTE &ldquo;clickear&aacute;&rdquo; acto seguido en la aplicaci&oacute;n aceptando la orden. El sistema en consecuencia efectuar&aacute; la liquidaci&oacute;n del valor del flete, la trayectoria y la distancia a recorrer.</p>\r\n\r\n<p>EL SOLICITANTE deber&aacute; fijar el lugar de recogida mediante la ubicaci&oacute;n GPS. La aplicaci&oacute;n le mostrar&aacute; la ruta y el tiempo estimado de llegada, as&iacute; como el valor (flete) del servicio.</p>\r\n\r\n<p>La Plataforma Tecnol&oacute;gica, no ofrece ninguna alternativa para realizar pagos on line, por lo que el pago del valor del respectivo flete, lo realizar&aacute; EL SOLICITANTE en efectivo al ANUNCIANTE una vez prestado servicio, al llegar a su lugar de destino.</p>\r\n\r\n<p>El servicio de soporte tecnol&oacute;gico que la Plataforma le presta al SOLICITANTE, es completamente gratuito. EL ANUNCIANTE por su parte, pagar&aacute; a la EMPRESA, una comisi&oacute;n sobre cada uno de los servicios prestados a los SOLICITANTES, por la utilizaci&oacute;n del soporte tecnol&oacute;gico que la Plataforma le brinda en la prestaci&oacute;n de cada servicio. El porcentaje y dem&aacute;s detalles relativos a las condiciones de uso de la Plataforma Tecnol&oacute;gica, le ser&aacute;n previamente informados al ANUNCIANTE, al momento de la creaci&oacute;n de su cuenta (o perfil) de USUARIO.</p>\r\n\r\n<p><strong>7. MEDIOS DE PAGO QUE SE PODR&Aacute;N UTILIZAR EN EL SITIO El SITIO </strong></p>\r\n\r\n<p>podr&aacute; indicar determinadas condiciones de compra seg&uacute;n el medio de pago que se utilice por el SOLICITANTE. <a href=\"http://www.cluster.com/\">www.cluster.com</a>.co podr&aacute; otorgar descuento en la forma de bonos que los SOLICITANTES podr&aacute;n descontar en el pago de su servicio de transporte o de cualquier otro servicio o producto que EL SITIO le ofrezca de manera promocional.</p>\r\n\r\n<p><strong>8. FORMACI&Oacute;N DEL CONSENTIMIENTO EN LOS CONTRATOS CELEBRADOS A TRAV&Eacute;S DE ESTE SITIO </strong></p>\r\n\r\n<p>Para toda operaci&oacute;n que se efect&uacute;e en este SITIO, la confirmaci&oacute;n y/o validaci&oacute;n o verificaci&oacute;n por parte del ANUNCIANTE, ser&aacute; requisito para la formaci&oacute;n del consentimiento. El consentimiento se entender&aacute; formado desde el momento en que el ANUNCIANTE &ldquo;clickee&rdquo; en el aplicativo aceptando la orden.</p>\r\n\r\n<p><strong>9. PRECIO</strong></p>\r\n\r\n<p>Los precios de los servicios disponibles en el Sitio, se establecer&aacute;n de acuerdo a las costumbres comerciales de cada regi&oacute;n, a partir de un algoritmo matem&aacute;tico de propiedad del SITIO. Los precios de los servicios ofrecidos en el Sitio est&aacute;n expresados en Pesos colombianos salvo que se manifieste lo contrario.</p>\r\n\r\n<p><strong>Advertencia:</strong> <a href=\"http://www.cluster.com/\">www.cluster.com</a>.co se reserva el derecho de revocar la orden de servicio, caso en el cual le notificar&aacute; al SOLICITANTE y el valor del precio le ser&aacute; acreditado en un bono electr&oacute;nico a su respectiva cuenta de USUARIO, para ser utilizado en posterior (es) servicio(s).</p>\r\n\r\n<p><strong>10. PROMOCIONES </strong></p>\r\n\r\n<p>Las promociones que se ofrezcan en este SITIO, se someter&aacute;n al cumplimiento de las normas vigentes y espec&iacute;ficamente a las disposiciones de la ley 1480 de 2011 (Estatuto del Consumidor).</p>\r\n\r\n<p><strong>11. RESPONSABILIDAD DE </strong><a href=\"http://www.cluster.com/\">WWW.CLUSTER.COM</a>.CO</p>\r\n\r\n<p>Har&aacute; lo posible dentro de sus capacidades para que la transmisi&oacute;n del SITIO sea ininterrumpida y libre de errores. Sin embargo, dada la naturaleza de la Internet, dichas condiciones no pueden ser garantizadas. En el mismo sentido, el acceso del SOLICITANTE a la Cuenta puede ser ocasionalmente restringido o suspendido con el objeto de efectuar reparaciones, mantenimiento o introducir nuevos Servicios. EL SITIO no ser&aacute; responsable por: (1) lucro cesante, da&ntilde;o emergente o p&eacute;rdidas de oportunidades comerciales, laborales ni de cualquier otra &iacute;ndole; (2) cualquier da&ntilde;o indirecto; (3) cualquier incumplimiento por acci&oacute;n u omisi&oacute;n, culpa o dolo del ANUNCIANTE.</p>\r\n\r\n<p><strong>12. NOTIFICACIONES</strong></p>\r\n\r\n<p>El USUARIO conviene que ser&aacute; notificado por <a href=\"http://www.cluster.com/\">www.cluster.com</a>.co, a trav&eacute;s del correo electr&oacute;nico registrado en su perfil de usuario dentro de la Plataforma Tecnol&oacute;gica.</p>\r\n\r\n<p>Ante cualquier comentario, inquietud o reclamaci&oacute;n respecto de los anteriores T&eacute;rminos y Condiciones, la Pol&iacute;tica de Privacidad, o la ejecuci&oacute;n de cualquiera de &eacute;stos; <a href=\"http://www.cluster.com/\">www.cluster.com</a>.co deber&aacute; ser notificada por escrito al correo electr&oacute;nico <a href=\"mailto:info@cluster.com\">info@cluster.com</a>.co, o al tel&eacute;fono via WatsApp 3128476268, Colombia.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>TRATAMIENTO DE DATOS PERSONALES</strong></p>\r\n\r\n<p>El presente escrito de pol&iacute;tica de tratamiento de datos personales, se ajusta al tenor de la Constituci&oacute;n Pol&iacute;tica y las leyes de la Rep&uacute;blica de Colombia; especialmente la 1266 de 2008 y 1581 de 2012 y su Decreto Reglamentario 1377 de 2013. Solamente utilizaremos el nombre y la informaci&oacute;n referente a personas naturales bajo los t&eacute;rminos previstos en nuestra Pol&iacute;tica de Privacidad. Mantendremos la informaci&oacute;n personal de nuestros USUARIOS durante el tiempo que nos sea requerido por la ley o debido a la relevancia de los propios fines para los que fueron recopilados. Usted puede visitar el sitio y navegar sin tener que proporcionar datos personales. Durante su visita al sitio, usted permanecer&aacute; an&oacute;nimo y en ning&uacute;n momento podremos identificarlo, a menos que Ud. tenga una cuenta en el sitio e inicie sesi&oacute;n con su nombre de SOLICITANTE y contrase&ntilde;a.</p>\r\n\r\n<p><strong>COOKIES </strong></p>\r\n\r\n<p>La aceptaci&oacute;n de las cookies no es un requisito para visitar el Sitio. Sin embargo, nos gustar&iacute;a se&ntilde;alar que el hecho de solicitar un servicio en el Sitio y la de aceptar una orden, s&oacute;lo es posible con la activaci&oacute;n de las cookies. Las cookies son peque&ntilde;os archivos de texto que identifican a su computadora en nuestro servidor como un SOLICITANTE &uacute;nico. Las cookies se pueden utilizar para reconocer su direcci&oacute;n de protocolo de Internet, lo que le ahorrar&aacute; tiempo mientras se encuentra en el Sitio o si quiere entrar a &eacute;l en el futuro. Utilizamos cookies para su comodidad en el uso del sitio (por ejemplo, para recordar qui&eacute;n es usted cuando se desea modificar su carrito de compras sin tener que volver a introducir su direcci&oacute;n de correo electr&oacute;nico) y no para obtener o usar cualquier otra informaci&oacute;n sobre usted (por ejemplo de publicidad segmentada u oculta). Su navegador puede ser configurado para no aceptar cookies, pero esto podr&iacute;a restringir su uso del Sitio y limitar su experiencia en el mismo. El uso de cookies no contiene ni afecta datos de car&aacute;cter personal o privado y no representa peligro de virus. Si desea obtener m&aacute;s informaci&oacute;n acerca de las cookies, vaya a <a href=\"http://www.allaboutcookies.org/\">http://www.allaboutcookies.org</a> o para obtener informaci&oacute;n sobre la eliminaci&oacute;n de ellos desde el navegador, visite <a href=\"http://www.allaboutcookies.org/manage-cookies/index.html\">http://www.allaboutcookies.org/manage-cookies/index.html</a>.</p>\r\n\r\n<p><strong>SEGURIDAD </strong></p>\r\n\r\n<p>Tenemos en marcha medidas t&eacute;cnicas y de seguridad para evitar el acceso no autorizado o ilegal o la p&eacute;rdida accidental, destrucci&oacute;n u ocurrencia de da&ntilde;os a su informaci&oacute;n. Cuando se recogen datos a trav&eacute;s del Sitio, recogemos sus datos personales en un servidor seguro. Nosotros usamos programas de protecci&oacute;n en nuestros servidores. Cuando recopilamos informaci&oacute;n de tarjetas de pago electr&oacute;nico, se utilizan sistemas de cifrado Secure Socket Layer (SSL) que codifica la misma evitando usos fraudulentos. Si bien no es posible garantizar la consecuci&oacute;n de un resultado estos sistemas han probado ser efectivos en el manejo de informaci&oacute;n reservada y toda vez que cuentan con mecanismos que impiden el acceso de amenazas externas (i.e. hackers). Se recomienda no enviar todos los detalles de tarjetas de cr&eacute;dito o d&eacute;bito sin cifrar las comunicaciones electr&oacute;nicas con nosotros. Mantenemos las salvaguardias f&iacute;sicas, electr&oacute;nicas y de procedimiento en relaci&oacute;n con la recolecci&oacute;n, almacenamiento y divulgaci&oacute;n de su informaci&oacute;n.</p>\r\n\r\n<p>Nuestros procedimientos de seguridad exigen que en ocasiones podremos solicitarle una prueba de identidad antes de revelar informaci&oacute;n personal. Usted es el &uacute;nico responsable de la protecci&oacute;n contra el acceso no autorizado a su contrase&ntilde;a y a su computadora.</p>\r\n\r\n<p><strong>I. DEFINICIONES</strong></p>\r\n\r\n<p>Para efectos de la presente pol&iacute;tica, las palabras que a continuaci&oacute;n se definen tendr&aacute;n el significado asignado en este cap&iacute;tulo, sea que se escriban o no en may&uacute;sculas, o que se encuentren en plural o singular.</p>\r\n\r\n<p><strong>Autorizaci&oacute;n: </strong>Consentimiento previo, expreso e informado del titular para llevar a cabo el Tratamiento de Datos Personales.</p>\r\n\r\n<p><strong>Aviso de Privacidad: </strong>Documento f&iacute;sico, electr&oacute;nico o en cualquier otro formato, generado por el Responsable del Tratamiento, que es puesto a disposici&oacute;n del Titular para el Tratamiento de sus Datos Personales, el cual comunica al Titular la informaci&oacute;n relativa a la existencia de las pol&iacute;ticas de tratamiento de informaci&oacute;n que le ser&aacute;n aplicables, la forma de acceder a las mismas y las caracter&iacute;sticas del Tratamiento que se pretende dar a los datos personales.</p>\r\n\r\n<p><strong>Dato Personal:</strong> Cualquier informaci&oacute;n vinculada o que pueda asociarse a una o varias personas naturales determinadas o determinables.</p>\r\n\r\n<p><strong>Datos Sensibles:</strong> Se entiende por datos sensibles aquellos que afectan la intimidad del Titular o cuyo uso indebido puede generar su 10 discriminaci&oacute;n, tales como aquellos que revelen el origen racial o &eacute;tnico, la orientaci&oacute;n pol&iacute;tica, las convicciones religiosas o filos&oacute;ficas, la pertenencia a sindicatos, organizaciones sociales, de derechos humanos o que promueva intereses de cualquier partido pol&iacute;tico o que garanticen los derechos y garant&iacute;as de partidos pol&iacute;ticos de oposici&oacute;n as&iacute; como los datos relativos a la salud, a la vida sexual y los datos biom&eacute;tricos, entre otros.</p>\r\n\r\n<p><strong>Encargado del Tratamiento:</strong> Persona natural o jur&iacute;dica, p&uacute;blica o privada, que por s&iacute; misma o en asocio con otros, realice el Tratamiento de Datos Personales por cuenta del Responsable del Tratamiento de Datos Personales.</p>\r\n\r\n<p><strong>Responsable del Tratamiento:</strong> Persona natural o jur&iacute;dica, p&uacute;blica o privada, que por s&iacute; misma o en asocio con otros, decida sobre la base de datos y/o el Tratamiento de los datos.</p>\r\n\r\n<p><strong>Titular:</strong> Persona natural cuyos datos personales sean objeto de Tratamiento.</p>\r\n\r\n<p><strong>Tratamiento de Datos Personales:</strong> Cualquier operaci&oacute;n o conjunto de operaciones sobre Datos Personales, tales como la recolecci&oacute;n, almacenamiento, uso, circulaci&oacute;n o supresi&oacute;n.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>II. NORMAS Y CRITERIOS DE APLICACI&Oacute;N </strong></p>\r\n\r\n<p><strong>1. PRINCIPIOS GENERALES PARA EL TRATAMIENTO DE DATOS PERSONALES</strong> En el Tratamiento de Datos Personales se cumplir&aacute; con los siguientes principios:</p>\r\n\r\n<p><strong>Principio de finalidad:</strong> El Tratamiento de Datos Personales debe obedecer a una finalidad leg&iacute;tima que se informar&aacute; al Titular.</p>\r\n\r\n<p><strong>Principio de libertad:</strong> El Tratamiento de Datos Personales s&oacute;lo puede ejercerse con el consentimiento, previo, expreso e informado del Titular. Los Datos Personales no podr&aacute;n ser obtenidos o divulgados sin previa autorizaci&oacute;n, o en ausencia de mandato legal o judicial que releve el consentimiento del Titular.</p>\r\n\r\n<p><strong>Principio de veracidad o calidad:</strong> La informaci&oacute;n sujeta a tratamiento debe ser veraz, completa, exacta, actualizada, comprobable y comprensible. Se proh&iacute;be el Tratamiento de datos parciales, incompletos, fraccionados o que induzcan a error.</p>\r\n\r\n<p><strong>Principio de transparencia:</strong> Tratamiento debe garantizarse el derecho del Titular a obtener de Www.olam.com, en cualquier momento y sin restricciones, informaci&oacute;n acerca de la existencia de datos que le conciernan.</p>\r\n\r\n<p><strong>Principio de acceso y circulaci&oacute;n restringida:</strong> Los Datos Personales, salvo la informaci&oacute;n p&uacute;blica, no podr&aacute;n estar disponibles en Internet u otros medios de divulgaci&oacute;n o comunicaci&oacute;n masiva, salvo que el acceso sea t&eacute;cnicamente controlable para brindar un conocimiento restringido s&oacute;lo a los Titulares o terceros autorizados por aqu&eacute;l.</p>\r\n\r\n<p><strong>Principio de seguridad:</strong> La informaci&oacute;n sujeta a Tratamiento, se deber&aacute; manejar con las medidas t&eacute;cnicas, humanas y administrativas que sean necesarias para otorgar seguridad a los registros evitando su adulteraci&oacute;n, p&eacute;rdida, consulta, uso o acceso no autorizado o fraudulento.</p>\r\n\r\n<p><strong>Principio de confidencialidad:</strong> Todas las personas que intervengan en el Tratamiento de Datos Personales est&aacute;n obligadas a garantizar la reserva de la informaci&oacute;n, inclusive despu&eacute;s de finalizada su relaci&oacute;n con alguna de las labores que comprende el tratamiento.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>2. TRATAMIENTO AL CUAL SER&Aacute;N SOMETIDOS LOS DATOS Y FINALIDAD DEL MISMO TERCEROS Y ENLACES</strong></p>\r\n\r\n<p>El SITIO <a href=\"http://www.cluster.com/\">www.cluster.com</a>.co podr&aacute; transferir y/o transmitir los datos personales sujetos a tratamiento a compa&ntilde;&iacute;as que hagan parte de su grupo empresarial, esto es, a compa&ntilde;&iacute;as matrices, filiales o subsidiarias. Tambi&eacute;n podemos proporcionar su informaci&oacute;n a nuestros agentes y subcontratistas para que nos ayuden con cualquiera de las funciones mencionadas en nuestra Pol&iacute;tica de Privacidad. Por ejemplo, podemos utilizar a terceros para que nos ayuden con la entrega de promoci&oacute;n de productos, recaudar sus pagos, enviar productos o tercerizar nuestros sistemas de servicio al cliente. Podemos intercambiar informaci&oacute;n con terceros a efectos de protecci&oacute;n contra el fraude y la reducci&oacute;n de riesgo de cr&eacute;dito. Podemos transferir nuestras bases de datos que contienen su informaci&oacute;n personal si vendemos nuestro negocio o parte de este. A su vez podr&aacute; compartir los datos personales recolectados, con terceros que tengan la calidad de aliados comerciales y/o de negocio para que puedan ofrecer productos y/o servicios que permitan mejorar la oferta de valor destinada a nuestros clientes. Al margen de lo establecido en la presente Pol&iacute;tica de Privacidad, no podremos vender o divulgar sus datos personales a terceros sin obtener su consentimiento previo, a menos que sea necesario para los fines establecidos en esta Pol&iacute;tica de Privacidad o estemos obligados a hacerlo por ley. El Sitio puede contener publicidad de terceros y enlaces a otros sitios o marcos de otros sitios. Tenga en cuenta que no somos responsables de las pr&aacute;cticas de privacidad o contenido de dichos terceros u otros sitios, ni por cualquier tercero a quien se transfieran sus datos de acuerdo con nuestra Pol&iacute;tica de Privacidad.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Teniendo en cuenta lo anterior los Datos Personales ser&aacute;n utilizados por la Plataforma Tecnol&oacute;gica para:</p>\r\n\r\n<p>a) Proveer los servicios requeridos.</p>\r\n\r\n<p>b) Informar sobre nuevos productos o servicios que est&eacute;n relacionados o no, con el contratado o adquirido por el Titular.</p>\r\n\r\n<p>c) Dar cumplimiento a obligaciones contra&iacute;das con el Titular.</p>\r\n\r\n<p>d) Informar sobre cambios en productos o servicios.</p>\r\n\r\n<p>e) Evaluar la calidad de productos o servicios.</p>\r\n\r\n<p>f) Desarrollar actividades de mercadeo o promocionales.</p>\r\n\r\n<p>g) Enviar al correo f&iacute;sico, electr&oacute;nico, celular o dispositivo m&oacute;vil, - v&iacute;a mensajes de texto (SMS y/o MMS) informaci&oacute;n comercial, publicitaria o promocional sobre los productos y/o servicios, eventos y/o promociones de tipo comercial o no de estas, con el fin de impulsar, invitar, dirigir, ejecutar, informar y de manera general, llevar a cabo campa&ntilde;as, promociones o concursos de car&aacute;cter comercial o publicitario.</p>\r\n\r\n<p>h) Enviar informaci&oacute;n v&iacute;a mensajes de texto (SMS y/o MMS) o v&iacute;a &quot;WhatsApp&quot; acerca de la entrega y estado de los pedidos realizados en el Sitio, por el cliente.</p>\r\n\r\n<p>i) Compartir, incluyendo la transferencia y transmisi&oacute;n de datos personales a terceros para fines relacionados con la operaci&oacute;n de la empresa.</p>\r\n\r\n<p>j) Realizar estudios internos sobre el cumplimiento de las relaciones comerciales y estudios de mercado a todo nivel.</p>\r\n\r\n<p>k) Responder requerimientos legales de entidades administrativas y judiciales.</p>\r\n\r\n<p>l) Compartir los datos personales recolectados con terceros que tengan la calidad de aliados comerciales y/o de negocio para puedan ofrecer productos y/o servicios que permitan mejorar la oferta de valor destinada a los clientes de la empresa, todo lo anterior de conformidad con lo dispuesto en la Ley 1581 de 2012 y su Decreto Reglamentario 1377 de 2013. El tratamiento de los datos personales, podr&aacute; implicar la recolecci&oacute;n, almacenamiento, uso, circulaci&oacute;n, supresi&oacute;n, transmisi&oacute;n, transferencia y/o recepci&oacute;n de datos, para la finalidad con que fueron suministrados.</p>\r\n\r\n<p><strong>3. AUTORIZACIONES </strong></p>\r\n\r\n<p>El Tratamiento de Datos Personales realizados por la empresa, requiere del consentimiento libre, previo, expreso e informado del Titular de dichos datos. La empresa, en su condici&oacute;n de Responsable del Tratamiento de Datos Personales, ha dispuesto de los mecanismos necesarios para obtener la autorizaci&oacute;n de los&nbsp;</p>\r\n\r\n<p>titulares garantizando en todo caso que sea posible verificar el otorgamiento de dicha autorizaci&oacute;n. La autorizaci&oacute;n podr&aacute; darse verbalmente y/o por medio de un documento f&iacute;sico, electr&oacute;nico o cualquier otro formato que permita garantizar su posterior consulta. En cualquier caso la autorizaci&oacute;n debe ser dada por el Titular y en &eacute;sta se debe poder verificar que &eacute;ste conoce y acepta que la empresa recoger&aacute; y utilizar&aacute; la informaci&oacute;n para los fines que para el efecto se le d&eacute; a conocer de manera previa al otorgamiento de la autorizaci&oacute;n.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>En virtud de lo anterior, la autorizaci&oacute;n solicitada deber&aacute; incluir:</p>\r\n\r\n<p>a) Responsable del Tratamiento y qu&eacute; datos se recopilan;</p>\r\n\r\n<p>b) La finalidad del tratamiento de los datos;</p>\r\n\r\n<p>c) Los derechos de acceso, correcci&oacute;n, actualizaci&oacute;n o supresi&oacute;n de los datos personales suministrados por el titular y,</p>\r\n\r\n<p>d) S&iacute; se recopilan Datos Sensibles.</p>\r\n\r\n<p>e) Adicionalmente se le informar&aacute; al Titular (i) que no se encuentra obligado a autorizar el tratamiento, y (ii) que es facultativo entregar este tipo de informaci&oacute;n</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>4. PROCEDIMIENTO PARA EL EJERCICIO DE LOS DERECHOS DE CONOCER, ACTUALIZAR, RECTIFICAR Y SUPRIMIR INFORMACION Y REVOCAR LA AUTORIZACI&Oacute;N </strong></p>\r\n\r\n<p>Los Titulares de los Datos Personales podr&aacute;n en cualquier momento solicitarle al Responsable del Tratamiento qu&eacute; informaci&oacute;n de ellos se conserva, as&iacute; como solicitar la actualizaci&oacute;n ratificaci&oacute;n o supresi&oacute;n de dicha informaci&oacute;n, usando los medios descritos en el numerar 7 de la presente pol&iacute;tica. Adicionalmente podr&aacute;n revocar la autorizaci&oacute;n otorgada.</p>\r\n\r\n<p>Con dicho fin, el Titular de la informaci&oacute;n a trav&eacute;s de los diferentes medios predeterminados por la empresa en el numeral 7, har&aacute; el reclamo indicando su n&uacute;mero de identificaci&oacute;n, los datos de contacto y aportando la documentaci&oacute;n pertinente que pretenda hacer valer. Si la empresa estima que para el an&aacute;lisis de la solicitud requiere mayor informaci&oacute;n de parte del titular, proceder&aacute; a comunicar tal situaci&oacute;n. Transcurridos dos (2) meses desde la fecha del requerimiento, sin que el solicitante presente la informaci&oacute;n requerida, se entender&aacute; que ha desistido del reclamo.</p>\r\n\r\n<p>El t&eacute;rmino m&aacute;ximo para atender el reclamo ser&aacute; de quince (15) d&iacute;as h&aacute;biles contados a partir del d&iacute;a siguiente a la fecha de su recibo. Cuando no fuere posible atenderlo dentro de dicho t&eacute;rmino se informar&aacute; al interesado antes del vencimiento del referido plazo los motivos de la demora y la fecha en que se atender&aacute; su reclamo, la cual en ning&uacute;n caso podr&aacute; superar los ocho (8) d&iacute;as h&aacute;biles siguientes al vencimiento del primer t&eacute;rmino.</p>\r\n\r\n<p>Cuando el Titular manifieste, por cualquier medio (comunicaci&oacute;n telef&oacute;nica, correo electr&oacute;nico, entre otros), que no desea recibir publicidad o que desea ser eliminado de las bases de datos de la empresa, se proceder&aacute; en un t&eacute;rmino de veinticuatro (24) a cuarenta y ocho (48) horas a enviar al solicitante un correo electr&oacute;nico confirmando la eliminaci&oacute;n de sus datos personales de las bases de datos de publicidad de la empresa. Adicionalmente, se le solicitar&aacute; que confirme si desea que se elimine su cuenta personal. A partir de la recepci&oacute;n de este correo, el cliente contar&aacute; con un t&eacute;rmino de cinco (5) d&iacute;as h&aacute;biles para realizar dicha confirmaci&oacute;n.</p>\r\n\r\n<p>En caso que el Titular confirme que desea que su cuenta personal sea eliminada o que finalizado el t&eacute;rmino de cinco (5) d&iacute;as no responda dicho correo, <a href=\"http://www.cluster.com\">www.cluster.com</a>.co, con el fin de cumplir con la normatividad vigente en materia de protecci&oacute;n de datos personales, proceder&aacute; a eliminar su cuenta personal, en un plazo de cinco (5) d&iacute;as h&aacute;biles.</p>\r\n\r\n<p>La eliminaci&oacute;n de la cuenta personal tendr&aacute; como consecuencia la eliminaci&oacute;n de toda la informaci&oacute;n del Titular, ocasionando la p&eacute;rdida de todo el historial de compras, cualquier cup&oacute;n de reembolso o descuento, y cualquier otra informaci&oacute;n que la empresa posea sobre &eacute;l.</p>\r\n\r\n<p>La solicitud de supresi&oacute;n de la informaci&oacute;n y la revocatoria de la autorizaci&oacute;n no proceder&aacute;n cuando el Titular tenga un deber legal, contractual o comercial de permanecer en la base de datos.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>5. DERECHOS Y DEBERES DE LOS TITULARES</strong></p>\r\n\r\n<p>&nbsp;El Titular de los Datos Personales tendr&aacute; los siguientes derechos:</p>\r\n\r\n<p>a) Conocer, actualizar y rectificar los Datos Personales.</p>\r\n\r\n<p>b) Solicitar pruebas de la autorizaci&oacute;n otorgada a la empresa.</p>\r\n\r\n<p>c) Ser informado por la empresa, previa solicitud, respecto del uso que le ha dado a sus Datos Personales.</p>\r\n\r\n<p>d) Presentar consultas ante el Responsable o Encargado del Tratamiento, conforme a lo establecido en el numeral 3 de la presente pol&iacute;tica, e interponer quejas ante la Superintendencia de Industria y Comercio.</p>\r\n\r\n<p>e) Acceder de manera gratuita a los Datos Personales que son objeto de Tratamiento en los t&eacute;rminos del art&iacute;culo 21 del Decreto 1377. El Titular de los Datos Personales tendr&aacute; el deber de mantener actualizada su informaci&oacute;n y garantizar, en todo momento, la veracidad de la misma. La empresa no se har&aacute; responsable, en ning&uacute;n caso, por cualquier tipo de responsabilidad derivada por la inexactitud de la informaci&oacute;n.</p>\r\n\r\n<p><strong>6. MEDIDAS DE SEGURIDAD</strong></p>\r\n\r\n<p>La empresa adoptar&aacute; las medidas t&eacute;cnicas, humanas y administrativas que sean necesarias para otorgar seguridad a los registros evitando su adulteraci&oacute;n, p&eacute;rdida, consulta, uso o acceso no autorizado o fraudulento. Dichas medidas responder&aacute;n a los requerimientos m&iacute;nimos hechos por la legislaci&oacute;n vigente y peri&oacute;dicamente se evaluar&aacute; su efectividad.</p>\r\n\r\n<p><strong>7. RESPONSABLE Y CONTACTO </strong></p>\r\n\r\n<p>La empresa estar&aacute; encargada de la recolecci&oacute;n y el Tratamiento de Datos Personales, la Autorizaci&oacute;n y los registros almacenados, en todos los casos, impidiendo que se deterioren, pierdan, alteren o se usen sin autorizaci&oacute;n y conservarlos con la debida seguridad.</p>\r\n\r\n<p>El &aacute;rea de servicio al cliente estar&aacute; a cargo de atender las peticiones, quejas y consultas de los titulares de los dato y los Titulares de la Informaci&oacute;n pueden ejercer sus derechos de conocer, actualizar, rectificar y suprimir sus Datos Personales, enviando comunicaciones al correo electr&oacute;nico <a href=\"mailto:info@cluster.com\">info@cluster.com</a>.co , o al tel&eacute;fono&nbsp; 312 8476268, Colombia.</p>\r\n\r\n<p><strong>8. ENTRADA EN VIGENCIA MODIFICACI&Oacute;N Y PERIODO DE VIGENCIA DE LAS BASES DE DATOS</strong></p>\r\n\r\n<p>La presente pol&iacute;tica aplicar&aacute; a partir del d&iacute;a 01 de septiembre de 2019 y La informaci&oacute;n suministrada por los grupos de inter&eacute;s permanecer&aacute; almacenada hasta por el t&eacute;rmino de cinco (5) a&ntilde;os contados a partir de la fecha del &uacute;ltimo Tratamiento, para permitirnos el cumplimiento de las obligaciones legales y/o contractuales a su cargo especialmente en materia contable, fiscal y tributaria. Esta pol&iacute;tica podr&aacute; ser modificada en cualquier momento y de forma unilateral por parte de la empresa.</p>\r\n\r\n<p><strong>T&eacute;rminos y Condiciones Espec&iacute;ficos del ANUNCIANTE CLUSTER</strong></p>\r\n\r\n<p>&iquest;Quiere ser ANUNCIANTE en nuestra aplicaci&oacute;n? Es muy f&aacute;cil. Primero aseg&uacute;rese que su veh&iacute;culo sea del modelo 2010 en adelante, tenga al menos cuatro (4) puertas, aire acondicionado y se encuentre en perfectas condiciones t&eacute;cnico mec&aacute;nicas. Ahora, solo debe crear su cuenta de usuario, diligenciando el siguiente formulario. Al diligenciar el siguiente formulario usted acepta los T&eacute;rminos y Condiciones generales, las Pol&iacute;ticas de Tratamiento de Datos Personales y los T&eacute;rminos y Condiciones Espec&iacute;ficos del ANUNCIANTE CLUSTER.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img src=\"file:///C:\\Users\\admin\\AppData\\Local\\Temp\\msohtmlclip1\\01\\clip_image001.png\" style=\"height:39px; width:51px\" />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<a href=\"http://cluster.com/provider/register\">http://cluster.com/provider/register</a>&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>-Documento de identidad</p>\r\n\r\n<p>-Licencia de conducci&oacute;n vigente</p>\r\n\r\n<p>-Tarjeta de propiedad</p>\r\n\r\n<p>-Tecnomecanica Vigente</p>\r\n\r\n<p>- Soat vigente</p>\r\n\r\n<p>Una vez diligencie el formulario y adjunte los documentos, el equipo Cluster realizar&aacute; un estudio de seguridad antes de dar de alta su cuenta de usuario (ANUNCIANTE). En un t&eacute;rmino m&aacute;ximo de 48 horas recibir&aacute; un mensaje al correo electr&oacute;nico por usted registrado, anunci&aacute;ndole el estado de su solicitud. Si su solicitud es aceptada, le daremos de alta a su cuenta de usuario y es all&iacute; cuando usted adquirir&aacute; el status de ANUNCIANTE, pudiendo hacer uso de nuestra Plataforma Tecnol&oacute;gica.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>EL ANUNCIANTE. </strong></p>\r\n\r\n<p>Cada vez que el ANUNCIANTE ingrese a la Plataforma Tecnol&oacute;gica a trav&eacute;s de su cuenta de usuario, podr&aacute; observar una pesta&ntilde;a que le da las opciones <strong>conectado/ no conectado</strong>. Usted deber&aacute; estar conectado para comenzar a recibir las solicitudes de servicios que de forma autom&aacute;tica le asignar&aacute; la aplicaci&oacute;n.</p>\r\n\r\n<p>Cuando un usuario (SOLICITANTE) pida un servicio, el algoritmo que desarrolla la aplicaci&oacute;n le enviar&aacute; la solicitud de servicio a los ANUNCIANTES m&aacute;s cercanos y el primero que acepte la solicitud en la plataforma, ser&aacute; quien preste dicho servicio.</p>\r\n\r\n<p>El ANUNCIANTE podr&aacute; visualizar en la orden de servicio, el nombre de la persona a quien recoger&aacute; y el lugar donde habr&aacute; de hacerlo.</p>\r\n\r\n<p>El ANUNCIANTE, al momento de recoger al usuario (SOLICITANTE) no sabr&aacute; cu&aacute;l sea el valor del servicio.</p>\r\n\r\n<p>Una vez que el SOLICITANTE llegue a su destino, el ANUNCIANTE proceder&aacute; con el cobro del valor del servicio prestado, pues solo hasta ese momento podr&aacute; conocer el monto exacto del mismo. El pago se har&aacute; en efectivo. El valor del servicio lo calcula la aplicaci&oacute;n a trav&eacute;s de un algoritmo seg&uacute;n distancia y tarifas de cluster. Muy pronto incluiremos el medio de pago a trav&eacute;s de tarjeta de cr&eacute;dito.</p>\r\n\r\n<p>Dentro de su cuenta de usuario, el ANUNCIANTE encontrar&aacute; una pesta&ntilde;a con la palabra &ldquo;ganancias&rdquo;. Esta le mostrar&aacute; el producido total de los &uacute;ltimos d&iacute;as. El ANUNCIANTE deber&aacute; realizar el pago del DIEZ PORCIENTO (10%) de ese producido a cluster, el d&iacute;a martes de cada semana hasta las 23:59 horas, a trav&eacute;s de transferencia o consignaci&oacute;n bancaria a la cuenta que se dar&aacute; una vez sea aceptado en la plataforma.</p>\r\n\r\n<p>Si el ANUNCIANTE no realizare el pago respectivo dentro del t&eacute;rmino acordado; la Plataforma Tecnol&oacute;gica inactivar&aacute; temporalmente y de manera autom&aacute;tica su cuenta, suspendiendo la opci&oacute;n <strong>conectado/no conectado</strong>. Una vez el ANUNCIANTE efectu&eacute; el pago extempor&aacute;neo correspondiente y este sea verificado por la Plataforma Tecnol&oacute;gica; se activar&aacute; autom&aacute;ticamente su cuenta, dentro de las 48 horas siguientes.</p>\r\n\r\n<p>El porcentaje que el ANUNCIANTE deber&aacute; pagar a cluster por la utilizaci&oacute;n de su Plataforma Tecnol&oacute;gica en arriendo o alquiler; ser&aacute; el equivalente al DIEZ POR CIENTO (10%) sobre el valor de cada servicio prestado.</p>\r\n\r\n<p>Las dem&aacute;s condiciones que rigen el presente acuerdo, se encuentran contenidas en los T&eacute;rminos y Condiciones generales. El tratamiento de los datos personales se rige por el acuerdo de Tratamiento de Datos Personales.</p>\r\n'),(115,'terms','<h2><strong>&nbsp; &nbsp;&nbsp;</strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong>Bono de&nbsp; &nbsp; COP 300.000</strong></h2>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>T&Eacute;RMINOS</strong></p>\r\n\r\n<ul>\r\n	<li>Por tu registro se activa saldo en tu billetera por&nbsp;COP300&nbsp;000 que los puedes utilizar para empezar a realizar tus carreras&nbsp;</li>\r\n</ul>\r\n\r\n<hr />\r\n<p><strong>CONDICIONES</strong></p>\r\n\r\n<ul>\r\n	<li>Promoci&oacute;n v&aacute;lida para los primeros 100&nbsp;conductores .</li>\r\n	<li>La promoci&oacute;n caduca cuando los primeros 100&nbsp;conductores rediman su bono.</li>\r\n	<li>Promoci&oacute;n v&aacute;lida para conductores que esten al d&iacute;a con la documentacion, con la tasa de servicio para Cluster.</li>\r\n	<li>Un bono por conductor.</li>\r\n	<li>Los servicios deben ser reales y se comprobar&aacute; la transparencia de los mismos.</li>\r\n	<li>El bono ser&aacute; transferido a su saldo para trabajar como conductor.</li>\r\n	<li>La promoci&oacute;n aplica para conductores de veh&iacute;culos,motos,camiones,vans,buses</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n'),(116,'help','<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h1>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong>&nbsp;WhatsApp 3128476268</strong></h1>\r\n'),(122,'site_copyright',NULL);
