CREATE TABLE `user_request_payments` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `request_id` int(11) NOT NULL,
  `user_id` int(11) NOT NULL,
  `admin_id` int(11) NOT NULL DEFAULT '0',
  `provider_id` int(11) NOT NULL,
